import React from 'react';
import '../Styles/Banner.css';

const Banner = () => {
  return (
    <div className="banner-container">
      <h1>Hi, I'm Pari.</h1>
      <p>
        CS Student @ UMD & UI/UX Designer. Currently, I'm based in New Jersey, 
        designing responsive websites and leading the creative process at 
        <strong> Hack4Impact-UMD</strong>.
      </p>
    </div>
  );
};

export default Banner;
